Stasion Jeruklegi (JRL) nyaéta stasion karéta api kelas III/leutik anu perenahna di Jeruklegi Wétan, Jeruklegi, Cilacap. Stasion anu aya dina tingkat kaluhuran +10 m ieu kaasup ka Daérah Operasi V Purwokerto. Stasion ieu miboga tilu jalur kalawan jalur 1 minangka jalur lurus.
Kiwari stasion ieu ngan ngalayanan pasilangan atawa pasusulan antar karéta api, henteu pikeun naék-turunkeun panumpang. Pasilangan anu sacara resmi dilayanan di stasion ieu dumasar Gapéka 2017 nyaéta:
